import Footer from '../../footer/Footer';
import Body from './body/Body';
import Nav from '../../nav/Nav';


const Title = styled.h1
`
    font-size: 500px;
`;

const HomePage = () => {
    return (
        <div>
            <h1>hi tamir</h1>
            <Nav/>
            <Body/>
            <Footer/>
        </div>
    )
}
export default HomePage;
